import React from 'react';
import ReactDOM from 'react-dom';

const src1 = "https://www.fillmurray.com/640/360";
const src2 = "https://loremflickr.com/640/360";

const heading = {
  color : 'red',
  textTransform : 'capitalize',
  fontSize : '20px'
};

ReactDOM.render(
  <>
  <h1 style={heading}>my name is raj kumawat</h1>
  <div>
    <img src={src1} alt="image1"/>
    <img src={src2} alt ="image2"/>
  </div>
  </>,
  document.getElementById("root")
);
